**Root cause:**  
- Returning `nullptr` from `getNewDefiningAccessForClone` is not always safe: the caller may use the result as an incoming value for a `MemoryPhi`, which is not allowed (PHI nodes must not have null incoming values).

**Correct fix:**  
- If `getNewDefiningAccessForClone` would return `nullptr`, it should instead return the live-on-entry definition (`MSSA->getLiveOnEntryDef()`), which is always valid and safe as a fallback.

**Patch:**
